      classEstilo = 'MenuLateral abrir'
    }
    return (
      <ContainerSide>
        <nav class={classEstilo}>
          <ul>
            <li><a href="/" className="botao">SOBRE</a></li>
            <li><a href="/" className="botao">NUTRISCRIPT</a></li>
            <li> <a href="/" className="botao">INFORMAÇÂO</a></li>
          </ul>
        </nav>
      </ContainerSide >
    )
  }
}
export default SideDrawer;
